import mongoose from 'mongoose'

import Team from '../models/team'

var teams = [];

for (var i = 1; i <= 8; i++) {
    teams.push({
        "rank": 9 - i, 
        "ID": i, 
        "score": (9 - i) * 10, 
        "history": [
            {
                "RFID": "12345678", 
                "score": (9 - i) * 10, 
                "timestamp": new Date().toISOString().replace(/T/, ' ').replace(/\..+/, ''), 
            }
        ]
    });
}

teams.sort((A, B) => (A.rank > B.rank) ? 1 : ((A.rank < B.rank) ? -1 : 0));

export default async () => { return teams; };
